Page({
    data:{
        labId:53,
        key:'3H8IFT',
        labName:'实验室 N5-101',
        userName:'赵丽华',
        telephone:'19953213840',
        duration:'0000年00月00日 00时00分',
        deadline:'0000年00月00日 00时00分',
        keyImg:''
    },
    onLoad:function(option){
        // this.setData({
        //     labId:option.labId,
        //     key:option.key,
        //     userName:option.userName,
        //     telephone:option.telephone,
        //     duration:option.duration,
        //     deadline:option.deadline,
        //     labName:option.labName,
        // })
        const scene = `labId=${this.data.labId}&key=${this.data.key}`;
        wx.pro.request({
            url:"https://api.yumik.top/api/v1/get/qrcode",
            method:'post',
            header:{
                'content-type':'application/x-www-form-urlencoded',
                'Authorization':wx.getStorageSync('token')
            },
            data:{
                scene:scene,
                envVersion:'develop'
            }
        }).then((res)=>{
            this.setData({keyImg:res.data.data.generateQRCode})
            this.drawPic()
        }).catch((e)=>{
            console.log(e)
        })
    },
    drawPic(){
        const query = wx.createSelectorQuery()
            query.select('#canvas')
            .fields({node:true,size:true})
            .exec((res)=>{
                const canvas = res[0].node;
                const dpr = wx.getSystemInfoSync().pixelRatio
                canvas.width = res[0].width * dpr
                canvas.height = res[0].height * dpr
                const ctx = canvas.getContext('2d');
                let img = canvas.createImage();
                img.src = "/images/Subtract.svg";
                img.onload = () =>{
                    ctx.drawImage(img,1,1,canvas.width,canvas.height);
                    ctx.textBaseline = "top";
                    ctx.textAlign = "center"
                    ctx.font = `600 ${24*dpr}px 黑体`;
                    ctx.fillStyle="#333333";
                    ctx.fillText(this.data.labName,res[0].width * dpr/2,24*dpr);
                    ctx.font = `400 ${14*dpr}px 黑体`;
                    ctx.fillStyle="#666666";
                    ctx.textAlign = "left"
                    ctx.fillText(`管理员：${this.data.userName}`,74*dpr,78*dpr);
                    ctx.textAlign = "center"
                    ctx.fillText(`联系电话：${this.data.telephone}`,134*dpr,106*dpr);
                    ctx.fillText(`密钥时限：${this.data.duration}`,res[0].width * dpr/2,134*dpr);
                    ctx.fillText(`成员时限：${this.data.deadline}`,res[0].width * dpr/2,162*dpr);
                    ctx.fillStyle="#C74242";
                    ctx.fillText("请注意实验室相关事项，注意实验安全",res[0].width * dpr/2,210*dpr);
                    const buffer = wx.base64ToArrayBuffer(this.data.keyImg), //base 转二进制
                    filePath = `${wx.env.USER_DATA_PATH}/temp_image.png`; //文件名
                    wx.getFileSystemManager().writeFile({ //写文件
                        filePath,
                        data: buffer,
                        encoding: 'utf8',
                        success:function(res){
                            wx.pro.getImageInfo({
                                src:filePath,
                            }).then((res)=>{
                                console.log(res.path)
                                let code = canvas.createImage();
                                code.src = res.path;
                                code.onload=()=>{
                                    ctx.drawImage(code,`${25*dpr}px`,`${268*dpr}px`,`${88*dpr}px`,`${88*dpr}px`)
                                }
                                ctx.restore();
                            })
                        }
                    })
                }
                ctx.restore();
                
            })
    },
})